import { connect } from 'react-redux';
import { makeStyles } from '@material-ui/styles';

const Home = ({
    uid,
}) => {
    return (
        <div>
            {uid}
        </div>
    );
};


const mapStateToProps = ({
    uid,
}) => ({
    uid,
});

export default connect(mapStateToProps)(Home);
